$(function () {
    var e = "42px";
    $(document).ready(function () {
        $(".cc-text").each(function () {
            var e = $(this);
            e.attr("box_h", e.height())
        });
        $(".cc-text").css("height", e);
        $(".navigate").addClass("close")
    });
    $(".navigate").click(function () {
        if ($(this).hasClass("open")) {
            $(this).parent().parent().find(".cc-text").animate({height: e});
            $(this).addClass("close").removeClass("open")
        } else {
            var t = $(this).parent().parent().find(".cc-text").attr("box_h") + "px";
            $(this).parent().parent().find(".cc-text").animate({height: t});
            $(this).addClass("open").removeClass("close")
        }
    })
});
